import React from 'react';
import ball1 from '../ball1.png';

function Store() {
  return (
    <div className="store1">
      <section className="item-display-sec">
        <div className="products">
          {[...Array(7)].map((_, index) => (
            <div key={index} className="card">
              <div className="img">
                <img src={ball1} className="product-img" alt="" />
              </div>
              <div className="desc">World 2023</div>
              <div className="title">Messi's ball</div>
              <div className="box">
                <div className="price">5 ETH</div>
                <button className="btn-store">Buy</button>
              </div>
            </div>
          ))}
        </div>
      </section>
    </div>
  );
}

export default Store;
